import React from 'react';
import HeaderSub from './HeaderSub'

class Header extends React.Component{

    render(){

        return(
            <header>
                <div className="logo"></div>
                <ul className="nav">
                    <li>Home</li>
                    <li className="container-sub-nav">
                        Shopping
                        <HeaderSub/>
                    </li>
                    <li>About Us</li>
                    <li>Contact Us</li>
                    <li>My Account</li>
                </ul>
            </header>
        );
    }

}

export default Header;
